import './App.css';
import AOS from 'aos';
import 'aos/dist/aos.css'; // You can also use <link> for styles
// ..
AOS.init({
  duration:3000,
  delay: 1000
});


function App() {
  return (
    <div className="App" data-aos="fade-in">
      hello there
    </div>
  );
}

export default App;
